import{_ as e,c as o,o as c,a8 as t}from"./chunks/framework.riYNsadV.js";const k=JSON.parse('{"title":"常见问题","description":"","frontmatter":{},"headers":[],"relativePath":"platform/overview/other/常见问题.md","filePath":"platform/overview/other/常见问题.md","lastUpdated":1710763967000}'),a={name:"platform/overview/other/常见问题.md"},r=t('<h1 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题">¶</a></h1><h2 id="通用问题" tabindex="-1">通用问题 <a class="header-anchor" href="#通用问题">¶</a></h2><blockquote><p>数据表大字段，查询时如何给排除</p></blockquote><blockquote><p>docker-compose部署,使用外置配置文件</p></blockquote><blockquote><p>异常时返回链路追踪id的使用 对后端请求出现异常时，后端的返回的响应头会携带<code>TraceId</code>对象，可以在控制台或者请求的响应头中看到，通过<code>TraceId</code>可以在ELK、plumelog、控制台、日志文件查询出此次请求的链路情况</p></blockquote><blockquote><p>如何配置不登录也可以直接访问的菜单路由 在<code>router.config.js</code>中添加路由时，在<code>mate</code>中添加<code>ignoreLogin: true</code>属性 <code>javascript { path: &#39;cs&#39;, name: &#39;cs&#39;, meta: { title: &#39;ce&#39;, ignoreLogin: true }, component: () =&gt; import(&#39;@/views/modules/chart/cs&#39;) } </code></p></blockquote><blockquote><p>Redis 多实例情况下，会收到多个过期事件 Redis提供的消息队列和过期事件通知，无法保证可靠行，需要自行进行兜底，如过期事件，在用在订单撤销的时候，需要另写定时任务进行兜底，</p></blockquote><blockquote><p>同时在取消订单时，也需要判断订单的状态。如需要高可靠的，可以选用专业消息中间件和对应的延时队列</p></blockquote><blockquote><p>自定义mybatis的mapper.xml后，运行时提示找不到文件及方法 需要自定义的mapper.xml在<code>resources/mapper</code>的子孙目录下，同时自定义mapper.xml必须以<code>mapper.xml</code>，否则会扫描不到文件，也可以根据自己需要更改<code>mybatis-plsu</code>的配置项目</p></blockquote><blockquote><p>未登录时也可以请求接口，未被拦截 通常是因为在dev模式下，查看<code>bootx.starter.auth.ignore-urls</code> 下接口是否被放行了</p></blockquote><blockquote><p>时间日期插件出现汉化不全 查看是否是更新了<code>moment</code> 的依赖版本，需要设置为<code>^2.21.0</code>，与<code>antdv</code> 版本对应</p></blockquote><blockquote><p>添加数据库监控 将<code>hikari</code>数据连接池更换为</p></blockquote><blockquote><p>启动时控制台报<code>Waiting for changelog lock....</code>错误</p></blockquote><p>原因是<code>Flowable锁表了</code>，解决方式是：<code>flw_ev_databasechangeloglock</code>中删除锁数据 ? 使用<code>lombok</code>的<code>AllArgsConstructor</code>、<code>RequiredArgsConstructor</code>时，加在字段的注解没有复制到构造参数上</p><blockquote><p>IOS上底部存在底部指示条，指示条的操作区域与页面底部存在重合，如何进行处理？</p></blockquote><blockquote><p>前端构建时出现 <code>[vite:reporter] chunk.moduleIds is not iterable</code> 错误，</p></blockquote><p>将 vite版本设置为4.3.*即可。</p><blockquote><p>启动时报 [see nested exception: java.sql.SQLSyntaxErrorException: Table &#39;QRTZ_LOOKS’ doesn&#39;t exist]</p></blockquote><p>将数据库设置为大小写不敏感</p><blockquote><p>使用maven将模块安装到本地或者打包时，报<code>Failed to execute goal org.apache.maven.plugins:maven-gpg-plugin:1.6:sign (sign-artifacts) on project service-iam: Unable to execute gpg command: Error while executing process. Cannot run program &quot;gpg&quot;: error=2, No such file or directory</code> 错误，</p></blockquote><p>执行命令式，增加 <code>-Dgpg.skip</code> 参数，如 <code>clean install -Dgpg.skip -Dmaven.javadoc.skip=true</code>命令</p>',21),d=[r];function p(l,s,i,n,u,m){return c(),o("div",null,d)}const g=e(a,[["render",p]]);export{k as __pageData,g as default};
